  .init_svg{
    z-index: -2;
    width: 100vw;
    height: 100vh;
    position: absolute;
    top: 0;
    overflow: hidden;
    svg{
      position: absolute;
      width: 100vw;
      min-width: 1000px;
      height: auto;
      display: block;
      opacity: 12;
      top: -100vw;
    }
    .waveOne{
      animation: waveOne 8s linear ;
    }
    @keyframes waveOne {
      20%,80% {
        top: 70%;
      }
      100% {
        top: 100%;
      }
    }
    .waveTwo{
      animation: waveTwo 8s linear ;
    }
    @keyframes waveTwo {
      20%,80% { 
        top: 50%;
      }
      100% {  
        top: 100%;
      }
    } 
    .waveThree{
      animation: waveThree 8s linear ;
    }
    @keyframes waveThree {
      20%,80% {
        top: 39%;
      }  
        100% {
          top: 100%;
        }
      }
      .waveFour{
        animation: waveFour 8s linear ;
      }
      @keyframes waveFour {
        20%,80% {
          top: 25.5%;
        }
        100% {
          top: 100%;
        }
    }
    .waveFive{
      animation: waveFive 8s linear ;
    }
    @keyframes waveFive {
      20%,80% {
        top: 15.5%;
      }
      100% {
        top: 100%;
      }
    }
    .waveSix{
      animation: waveSix 8s linear ;
    }
    @keyframes waveSix {
      20%,80% {
        top: 4.3%;
      }
      100% {
        top: 100%;
      }
    }
    .waveSeven{
      opacity: 1;
      bottom: 0;
      animation: waveSeven 8s linear ;
    }
    @keyframes waveSeven {
      20%,80% {
        top: -14%;
      }
      100% {
        top: 100%;
      }
    }
  }
  .menu{
    width: 250px;
