  .burger{
    position: absolute;
    background: @grayBlack;
    width: 60px;
    height: 60px;
    right: 0;
    bottom: 20px;
    padding: 18px;
    left: 0;
    border-radius: 0 10px 10px 0;
    z-index: 99;
    .hover;
    &.show{
      .hover;
      left: 170px;
    }
    svg{
      width: 24px;
      height: 24px;
    }
