  .tooltip-inner {
    background-color: @grayBlack !important;
    color: #fff ;
    padding: 10px 20px;
    font-size: 16px;
    font-family: @fontFamily;
    font-weight: 600;
    border: none;
  }
  .bs-tooltip-top .arrow::before, .bs-tooltip-auto[x-placement^="top"] .arrow::before {
    border-top-color: @grayBlack !important;
  }
  .bs-tooltip-right .arrow::before, .bs-tooltip-auto[x-placement^="right"] .arrow::before {
    border-right-color: @grayBlack !important;
  }
  .bs-tooltip-bottom .arrow::before, .bs-tooltip-auto[x-placement^="bottom"] .arrow::before {
    border-bottom-color: @grayBlack !important;
  }
  .bs-tooltip-left .arrow::before, .bs-tooltip-auto[x-placement^="left"] .arrow::before {
    border-left-color: @grayBlack !important;
  }
  .bgDash{
    display: block;
    position: fixed;
    width: 100%;
    height: 100%;
    object-fit: cover;
    z-index: -1;
  }
  .loading{
    display: flex;
    position: fixed;
    background: #000000d4;
    width: 100vw;
    height: 100vh;
    z-index: 99;
    backdrop-filter: blur(5px);
    .centerFlex;
    img{
      width: 125px;
      z-index: 99;
    }
  }
  .ring {
    display: inline-block;
    position: absolute;
    
    .circle{
      border-radius: 50%;
      display: inline-block;
      margin: 5px;
      width: calc( 100% - 10px );
      height: calc( 100% - 10px );
      position: absolute;
      
    }
    &:after {
      content: " ";
      display: block;
      width: 100%;
      height: 100%;
      border-radius: 50%;
      border: 2px solid rgb(255, 255, 255);
      border-color: #fff transparent #fff transparent ;
      box-shadow: 0px 0px 50px 5px rgba(0,0,0,0.4);
      -webkit-box-shadow: 0px 0px 50px 5px rgba(0,0,0,0.4);
      -moz-box-shadow: 0px 0px 50px 5px rgba(0,0,0,0.4);
    }
    //----
    &.one{
      width: 250px;
      height: 250px;
      &:after{
        background: #0000001f;
        border-width: 6px;
        animation: ring 8s linear infinite;
      }
    }
    &.two{
      width: 400px;
      height: 400px;
      &:after{
        border-width: 1px;
        animation: ring 10s linear infinite;
      }
    }
  }
  @keyframes ring {
    0% { transform: rotate(0deg); }
    100% { transform: rotate(360deg); }
  }
