  body{
    margin:0;
    padding: 0;
  }
  #app {
    font-family: @fontFamily, sans-serif;
    -webkit-font-smoothing: antialiased;
    -moz-osx-font-smoothing: grayscale;
    color: #2f2f2f;
  }
  .section{
    width: 100%;
    padding: 20px;
  }
  // Dash Styles
  .paper-dash{   
    //Genesis
    &.genesis{
      background: #5F5F5F;
      width: 100vw;
      height: 100%;
      padding: 40px;
      .container-in{
        .bgDash{
          z-index: 0;
          width: 100%; 
          height: 100%; 
          object-fit: cover; 
          position: absolute;
          top: 0;
          left: 0;
          opacity: 0.5;
          //display: none;
        }
        width: 440px;
        height: 900px;
        background: @light;
        border-radius: 50px;
        border: 10px solid @dark;
        overflow: hidden;
        display: block;
        position: relative;
        display: flex;
        .wrap{
          margin: 30px auto;
          width: 300px;
          align-content: center;
          justify-content: center;
          z-index: 9;
          .logo{
            width: 200px;
            margin: 0 0 40px 0;
          }
          .input-wrap{
            width: 100%;
          }
          .btn-g{
            margin: auto;
            max-width: 200px;
            background: @g-blue;
            &:hover{
              color: @light;
            }
          }
          &.confirm{
            label{
              margin: 0 auto 20px;
            }
            .inputs{
              display: flex;
              align-items: center;
              justify-content: space-between;
              flex-wrap: nowrap;
              input{
                width: 20%;
                border-radius: 10px;
                text-align: center;
                font-weight: 700;
              }
            }
          }
        }
        .view{
          z-index: 1;
          width: 100%;
          .header{
            background: #023047;
            height: 80px;
            display: flex;
            align-items: center;
            justify-content: space-between;
            flex-wrap: nowrap;
            padding: 0 30px;
            margin: 0 0 30px 0;
            .h-logo{
              width: 150px;
            }
            .h-menu{
          }

          }
          .section{
            display: flex;
            flex-wrap: wrap;
            justify-content: space-between;
            padding: 0 30px;
